        <div className="col-md-6">
            <h3>Products</h3>
            <div className="row">

            {
                        propss.date2.map(elm => {
                            return <tr key={elm.id}>
                                <td>{elm.title}</td>
                                <td>{elm.price}</td>
                                <td>{elm.count}</td>
                                <td>{elm.count * elm.price}</td>
                                <td><button onClick={() => propss.onCount(elm)}>countUP</button></td>
